import "./App.css";
import SegmentChartGrandient from "./SegmentChartGrandient";
import SegmentChart from "./SegmentChart";
import BarChart from "./BarChart";
import 'bootstrap/dist/css/bootstrap.min.css';
import { Card,Container, Button } from "react-bootstrap";

function App() {
  return ( 
<Container className="mt-5 ms-7 d-flex flex-column" >
<Card style={{ width: '50rem' }}> 

      <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <BarChart />
        <Card.Text>
          Some quick summary of annual sales
        </Card.Text>
        <Button variant="primary">Detail</Button>
      </Card.Body>
    </Card>
    <Card style={{ width: '50rem' }} className="me-auto"> 

      <Card.Body>
        <Card.Title>Card Title</Card.Title>
        <BarChart />
        <Card.Text>
          Some quick summary of annual sales
        </Card.Text>
        <Button variant="primary">Detail</Button>
      </Card.Body>
    </Card>
<SegmentChartGrandient /><SegmentChart/>
</Container>
  ) ;
}

export default App;
